Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData = spark.read.format("csv").option("header", "true").load("onsite_data.csv")
      .select("query", "timestamp")
      .rdd
      .map(row => (row.getString(0), row.getLong(1)))

    // Load top frequent queries
    val topQueries = spark.read.format("csv").option("header", "true").load("top_queries.csv")
      .select("query")
      .rdd
      .map(row => row.getString(0))
      .collect()
      .toSet

    // Broadcast top queries to all nodes
    val broadcastTopQueries = spark.sparkContext.broadcast(topQueries)

    // Initialize cache
    val cache = Map[String, (Long, Int)]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val currentCache = cache.synchronized {
        cache ++ iter.filter(record => broadcastTopQueries.value.contains(record._1)).map { record =>
          val (query, timestamp) = record
          val cacheEntry = cache.getOrElse(query, (timestamp, 0))
          val (lastAccessTime, hitCount) = cacheEntry
          val isHit = timestamp - lastAccessTime <= 12 * 60 * 60 * 1000 // 12 hours in milliseconds
          if (isHit) {
            (query, (timestamp, hitCount + 1))
          } else {
            (query, (timestamp, 1))
          }
        }
      }
      currentCache.values.map(entry => entry._2 > 1).count(_ == true).toDouble / currentCache.size
    }).reduce(_ + _) / onsiteData.getNumPartitions

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from CSV files. It then broadcasts the top frequent queries to all nodes in the cluster. The cache is initialized as an empty mutable map.

The job then processes the onsite data by filtering out the records that are not in the top frequent queries. For each record, it checks if the query is already in the cache and if it has been accessed within the last 12 hours. If it is a hit, the hit count is incremented. Otherwise, the query is added to the cache with a hit count of 1.

Finally, the hit rate is calculated as the number of hits divided by the total number of records in the cache. The hit rate is then printed to the console.

